import React from 'react';
import styles from './Registration.module.scss';
import useAuthStore from '../../stores/authStore';
import { SubmitHandler, useForm } from 'react-hook-form';

type FormValues = {
    username: string,
    email: string,
    password: string,
    confirmPassword: string
}


const Registration = () => {
    const reg = useAuthStore(state => state.register);
    const setError = useAuthStore(state => state.setError);
    const errorText = useAuthStore(state => state.errText); 
    const { register, handleSubmit, formState: { errors } } = useForm<FormValues>({
        mode: 'onChange'
    });

    const onSubmit: SubmitHandler<FormValues> = (data) => {
        if(data.password !== data.confirmPassword) {
            setError('Passwords not match');
        } else if(data.email.split('@')[1].length < 5 || !data.email.split('@')[1].includes('.')) {
            setError('Please enter a valid email');
        } else {
            reg(data.email, data.username, data.password);
            setError('')
        }
    }

    return (
        <div className={styles.main}>
            <div className={styles.formContainer}>
                <h2 className={styles.header}>Sign Up</h2>
                <form onSubmit={handleSubmit(onSubmit)}>
                    <div className={styles.inputField}>
                        <label className={styles.label} htmlFor='username'>Username</label>
                        <input {...register('username', {
                            minLength: { value: 3, message: 'Username must contain at least 3 characters' },
                            maxLength: { value: 24, message: 'Username can contain maximum 24 characters' }, required: 'This field required'
                        })}
                            className={styles.input} type='text' id='username' name='username' required />
                            {errors.username?.message && <p className={styles.error}>{errors.username?.message}</p>}
                    </div>
                    <div className={styles.inputField}>
                        <label className={styles.label} htmlFor='email'>Email</label>
                        <input {...register('email', {
                            minLength: { value: 5, message: 'Email must contain at least 5 characters' },
                            maxLength: { value: 64, message: 'Email can contain maximum 64 characters' }, required: 'This field required'
                        })}
                            className={styles.input} id='email' name='email' required />
                            {errors.email?.message && <p className={styles.error}>{errors.email?.message}</p>}
                    </div>
                    <div className={styles.inputField}>
                        <label className={styles.label} htmlFor='password'>Password</label>
                        <input {...register('password', {
                            minLength: { value: 8, message: 'Password must contain at least 8 characters' }
                            , maxLength: { value: 64, message: 'Password can contain maximum 64 characters' }, required: 'This field required'
                        })}
                            className={styles.input} type='password' id='password' name='password' required />
                            {errors.password?.message && <p className={styles.error}>{errors.password?.message}</p>}
                    </div>
                    <div className={styles.inputField}>
                        <label className={styles.label} htmlFor='confirmPassword'>Confirm Password</label>
                        <input {...register('confirmPassword',)}
                            className={styles.input} type='password' id='confirmPassword' name='confirmPassword' required />
                            {errors.confirmPassword?.message && <p className={styles.error}>{errors.confirmPassword?.message}</p>}
                    </div>
                    {errorText ? <p className={styles.error}>{errorText}</p> : ''}
                    <button className={styles.button} type='submit'>Sign Up</button>
                </form>
            </div>
        </div>
    );
};

export default Registration;
